import React, { Component } from 'react';

class Form extends Component {
  render() {
    return (
      <>
        <span>Meu formulário</span>
        <form>
          <fieldset>
              <label>Nome</label>
              <input type='text' name='name' maxLength='40' required></input>
          </fieldset>
        </form>
      </>
    );
  }
}

export default Form;
